  numbered_duplicates AS (
    SELECT
        ROW_NUMBER() OVER (
            PARTITION BY
                client_id,
                submission_timestamp,
                document_id
            ORDER BY submission_timestamp
            ASC
        ) AS _n,
        * REPLACE(LOWER(client_id) AS client_id)
